```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.6.12;

contract ShrimpFarm {
    mapping (address => uint256) public hatcheryshrimp;
    mapping (address => uint256) public claimedeggs;
    mapping (address => uint256) public lasthatch;
    mapping (address => address) public referrals;
    uint256 public marketeggs;
    uint256 public eggs_to_hatch_1shrimp = 0x15180;
    uint256 private totalSupply = 10000;
    uint256 private totalSupply1 = 5000;
    address payable public ceoaddress;
    bool public initialized = false;

    constructor() public payable {
        if (msg.value == 0) {
            ceoaddress = msg.sender;
        }
    }

    function seedMarket(uint256 eggs) public payable {
        require(marketeggs == 0);
        initialized = true;
        marketeggs = eggs;
    }

    function hatchEggs(address ref) public {
        require(initialized == true);
        if (referrals[msg.sender] == address(0) && referrals[msg.sender] != msg.sender) {
            referrals[msg.sender] = ref;
        }
        uint256 eggsUsed = getMyEggs();
        uint256 newShrimp = SafeMath.div(eggsUsed, eggs_to_hatch_1shrimp);
        hatcheryshrimp[msg.sender] = SafeMath.add(hatcheryshrimp[msg.sender], newShrimp);
        claimedeggs[msg.sender] = 0;
        lasthatch[msg.sender] = now;

        //send referral eggs
        claimedeggs[referrals[msg.sender]] = SafeMath.add(claimedeggs[referrals[msg.sender]], SafeMath.div(eggsUsed, 5));

        //boost market to nerf shrimp hoarding
        marketeggs = SafeMath.add(marketeggs, SafeMath.div(eggsUsed, 10));
    }

    function sellEggs() public {
        require(initialized == true);
        uint256 hasEggs = getMyEggs();
        uint256 eggValue = calculateEggSell(hasEggs);
        uint256 fee = devFee(eggValue);
        claimedeggs[msg.sender] = 0;
        lasthatch[msg.sender] = now;
        marketeggs = SafeMath.add(marketeggs, hasEggs);
        ceoaddress.transfer(fee);
        msg.sender.transfer(SafeMath.sub(eggValue, fee));
    }

    function buyEggs() public payable {
        require(initialized == true);
        uint256 eggsBought = calculateEggBuy(msg.value, SafeMath.sub(address(this).balance, msg.value));
        eggsBought = SafeMath.sub(eggsBought, devFee(eggsBought));
        ceoaddress.transfer(devFee(msg.value));
        claimedeggs[msg.sender] = SafeMath.add(claimedeggs[msg.sender], eggsBought);
    }

    function calculateTrade(uint256 rt, uint256 rs, uint256 bs) public view returns(uint256) {
        return SafeMath.div(SafeMath.mul(bs, rs), rt);
    }

    function calculateEggSell(uint256 eggs) public view returns(uint256) {
        return calculateTrade(eggs, marketeggs, address(this).balance);
    }

    function calculateEggBuy(uint256 eth, uint256 contractBalance) public view returns(uint256) {
        return calculateTrade(eth, contractBalance, marketeggs);
    }

    function calculateEggBuySimple(uint256 eth) public view returns(uint256) {
        return calculateEggBuy(eth, address(this).balance);
    }

    function devFee(uint256 amount) public pure returns(uint256) {
        return SafeMath.div(SafeMath.mul(amount, 4), 100);
    }

    function getMyShrimp() public view returns(uint256) {
        return hatcheryshrimp[msg.sender];
    }

    function getMyEggs() public view returns(uint256) {
        return SafeMath.sub(claimedeggs[msg.sender], lastHatch[msg.sender]);
    }
}
```

This contract implements a simple game where users can buy eggs, hatch shrimp from eggs, and sell eggs. Users can refer other users and earn a bonus when the referred user hatches eggs. The contract uses SafeMath to prevent overflows and underflows. The `seedMarket` function initializes the game by setting the initial egg supply. The `hatchEggs` function hatches shrimp from eggs and gives a bonus to the referrer. The `sellEggs` function sells eggs for ether. The `buyEggs` function buys eggs with ether. The `calculateTrade` function calculates the amount of ether or eggs a user gets when buying or selling. The `devFee` function calculates the fee for the developer. The `getMyShrimp` and `getMyEggs` functions return the number of shrimp and eggs a user has.
